#include "uox3.h"

// Play sound effect for player or all players in range depending on bAllHear
// (default only player)
void soundeffect( cSocket *s, UI16 effect, bool allHear ) // Play sound effect for player
{
	if( s == NULL ) 
		return;
	CChar *mChar = s->CurrcharObj();
	if( mChar == NULL ) 
		return;

	CPPlaySoundEffect toSend = (*mChar);
	toSend.Model( effect );
	if( allHear )
	{
		Network->PushConn();
		for( cSocket *tSock = Network->FirstSocket(); !Network->FinishedSockets(); tSock = Network->NextSocket() )
		{
			if( charInRange( s, tSock ) )
				tSock->Send( &toSend );
		}
		Network->PopConn();
	}
	s->Send( &toSend );
}

void soundeffect( CChar *p, UI16 effect )
{
	if( p == NULL ) 
		return;

	CPPlaySoundEffect toSend = (*p);
	toSend.Model( effect );
	Network->PushConn();
	for( cSocket *tSock = Network->FirstSocket(); !Network->FinishedSockets(); tSock = Network->NextSocket() )
	{
		if( charInRange( p, tSock->CurrcharObj() ) )
			tSock->Send( &toSend );
	}
	Network->PopConn();
}

void soundeffect( CItem *p, UI16 effect )
{
	if( p == NULL ) 
		return;

	CPPlaySoundEffect toSend = (*p);
	toSend.Model( effect );
	Network->PushConn();
	for( cSocket *tSock = Network->FirstSocket(); !Network->FinishedSockets(); tSock = Network->NextSocket() )
	{
		if( itemInRange( tSock->CurrcharObj(), p ) )
			tSock->Send( &toSend );
	}
	Network->PopConn();
}

void soundeffect( CItem *p, cSocket *s, UI16 effect )
{
	if( s == NULL || p == NULL )
		return;
	CPPlaySoundEffect toSend = (*p);
	toSend.Model( effect );
	s->Send( &toSend );
}


// Dupois - added doorsfx() to be used with dooruse()
// Added Oct 8, 1998
// Plays the proper door sfx for doors/gates/secretdoors
void doorsfx( CItem *item, UI16 id, bool isOpen )
{
	const UI16 OPENWOOD		= 0x00EA;
	const UI16 OPENGATE		= 0x00EB;
	const UI16 OPENSTEEL	= 0x00EC;
	const UI16 OPENSECRET	= 0x00ED;
	const UI16 CLOSEWOOD	= 0x00F1;
	const UI16 CLOSEGATE	= 0x00F2;
	const UI16 CLOSESTEEL	= 0x00F3;
	const UI16 CLOSESECRET	= 0x00F4;
	
	if( isOpen == 0 ) // Request open door sfx
	{
		if( ( id >= 0x0695 && id < 0x06C5 ) || // Open wooden / ratan door
			( id >= 0x06D5 && id <= 0x06F4 ) )
			soundeffect( item, OPENWOOD );
		
		if( ( id >= 0x0839 && id <= 0x0848 ) || // Open gate
			( id >= 0x084C && id <= 0x085B ) ||
			( id >= 0x0866 && id <= 0x0875 ) )
			soundeffect( item, OPENGATE );
		
		if( ( id >= 0x0675 && id < 0x0695 ) || // Open metal
			( id >= 0x06C5 && id < 0x06D5 ) )
			soundeffect(item, OPENSTEEL );
		
		if( id >= 0x0314 && id <= 0x0365 ) // Open secret
			soundeffect( item, OPENSECRET );
	}
	else if( isOpen == 1 ) // Request close door sfx
	{
		if( ( id >= 0x0695 && id < 0x06C5 ) || // close wooden / ratan door
			( id >= 0x06D5 && id <= 0x06F4 ) )
			soundeffect( item, CLOSEWOOD );
		
		if( ( id >= 0x0839 && id <= 0x0848 ) || // close gate
			( id >= 0x084C && id <= 0x085B ) ||
			( id >= 0x0866 && id <= 0x0875 ) )
			soundeffect( item, CLOSEGATE );
		
		if( ( id >= 0x0675 && id < 0x0695 ) || // close metal
			( id >= 0x06C5 && id < 0x06D5 ) )
			soundeffect( item, CLOSESTEEL );
		
		if( id >= 0x0314 && id <= 0x0365 ) // close secret
			soundeffect( item, CLOSESECRET );
	}
}

void scpSoundEffect( cBaseObject *baseObj, UI16 soundID, bool bAllHear )
{
	if( baseObj == NULL )
		return;
	CPPlaySoundEffect toSend = (*baseObj);
	toSend.Model( soundID );
	if( bAllHear )
	{
		UI16 distance = MAXVISRANGE + Races->VisRange( baseObj->GetRace() );
		Network->PushConn();
		for( cSocket *tSock = Network->FirstSocket(); !Network->FinishedSockets(); tSock = Network->NextSocket() )
		{
			if( baseObj == tSock->CurrcharObj() || objInRange( baseObj, tSock->CurrcharObj(), distance ) )
				tSock->Send( &toSend );
		}
		Network->PopConn();
	}
	else
	{
		if( baseObj->GetObjType() == OT_CHAR )
		{
			cSocket *mSock = calcSocketObjFromChar( (CChar *)baseObj );
			mSock->Send( &toSend );
		}
	}
}

void scpSoundEffect( cSocket *mSock, UI16 soundID, bool bAllHear )
{
	if( mSock == NULL )
		return;

	CChar *baseObj = mSock->CurrcharObj();
	CPPlaySoundEffect toSend = (*baseObj);
	toSend.Model( soundID );
	if( bAllHear )
	{
		Network->PushConn();
		for( cSocket *tSock = Network->FirstSocket(); !Network->FinishedSockets(); tSock = Network->NextSocket() )
		{
			if( charInRange( mSock, tSock ) )
				tSock->Send( &toSend );
		}
		Network->PopConn();
	}
	else
		mSock->Send( &toSend );
}

// Dupois - added to do easy item sound effects based on an 
//          items id1 and id2 fields in struct items. Then just define the CASE statement
//          with the proper sound function to play for a certain item as shown.
//          Use the DEFAULT case for ranges of  items (like all ingots make the same thump).
// Sounds - coins dropping (all the same no matter what amount because all id's equal 0x0EED
//          ingot dropping (makes a big thump - used the heavy gem sound)
//          gems dropping (two type broke them in half to make some sound different then others)
// NOTE   - I wasn't sure what the different soundeffect() func's did so I just used 
//          soundeffect() and it seemed to work fairly well.
// Added Oct 09, 1998

void itemsfx( cSocket *s, UI16 effect, bool bAllHear )
{
	if( effect >= 0x0F0F && effect <= 0x0F20 )  // Any gem stone (typically large)
		soundeffect( s, 0x0032, bAllHear );
	else if( effect >= 0x0F21 && effect <= 0x0F30 )  // Any gem stone (typically small)
		soundeffect( s, 0x0034, bAllHear );
	else
		soundeffect( s, 0x0042, bAllHear );
}

void goldsfx( cSocket *s, int goldtotal, bool bAllHear )
{
	if( goldtotal == 1 ) 
		soundeffect( s, 0x0035, bAllHear );
	if( goldtotal > 1 && goldtotal < 6 ) 
		soundeffect( s, 0x0036, bAllHear );
	else 
		soundeffect( s, 0x0037, bAllHear );
	return;
}

//o---------------------------------------------------------------------------o
//|	Function	-	void playMonsterSound( CChar *monster, UI16 id, int sfx )
//|	Programmer	-	Unknown
//o---------------------------------------------------------------------------o
//|	Purpose		-	Play proper sound effect based on monsters skin
//o---------------------------------------------------------------------------o
void playMonsterSound( CChar *monster, UI16 id, UI08 sfx )
{
	SI32 basesound = creatures[id].BaseSound();
	UI08 sf = creatures[id].SoundFlag();
	UI08 offset = sfx;
	
	if( basesound != 0 )
	{
		switch( sf )
		{
		case 0: ; break; // in normal case the offset is correct
		case 1: ; break; // birds sounds will be implmented later
			
		case 2:  // only start-attack, attack & dýing sounds available
			switch( sfx )
			{
			case 1:
			case 3:	offset = 0xffff;	break;	// idle, defend
			case 2:	offset = 1;		break; // correct offset
			case 4:	offset = 2;		break;
			}
			break;
        case 3: // only start-attack, attack, defense & dying
			switch( sfx )
			{
			case 1:	offset = 0xffff;	break;
			case 2:
			case 3:
			case 4:	offset = sfx - 1;	break;
			}
            break;
		case 4: // only a single sound
			if( sfx != 0 ) 
				offset = 0xffff; 
			else 
				offset = 0;
			break;
		}
		
		basesound += offset;
		
		if( offset != 0xffff ) 
			soundeffect( monster, basesound );
	}
}

//o---------------------------------------------------------------------------o
//|	Function	-	void playDeathSound( CChar *i )
//|	Programmer	-	Unknown
//o---------------------------------------------------------------------------o
//|	Purpose		-	Send death sound to all sockets in range
//o---------------------------------------------------------------------------o
void playDeathSound( CChar *i )
{
	if( i->GetxID() == 0x0191 )// Female Death
	{
		switch( RandomNum( 0, 3 ) )
		{
		case 0:		soundeffect( i, 0x0150 );	break;
		case 1:		soundeffect( i, 0x0151 );	break;
		case 2:		soundeffect( i, 0x0152 );	break;
		case 3:		soundeffect( i, 0x0153 );	break;
		default:	soundeffect( i, 0x0150 );	break;
		}
	}
	if( i->GetxID() == 0x0190 )	// Male Death
	{
		switch( RandomNum( 0, 3 ) )
		{
		case 0:		soundeffect( i, 0x015A );	break;
		case 1:		soundeffect( i, 0x015B );	break;
		case 2:		soundeffect( i, 0x015C );	break;
		case 3:		soundeffect( i, 0x015D );	break;
		default:	soundeffect( i, 0x015A );	break;
		}
	}
	else
		playMonsterSound( i, i->GetxID(), SND_DIE );
}

