//o---------------------------------------------------------------------------o
//|	Function	-	void bgsound( CChar *s )
//|	Programmer	-	Unknown
//o---------------------------------------------------------------------------o
//|	Purpose		-	Play background sounds based on location
//o---------------------------------------------------------------------------o
void bgsound( CChar *s )
{
	if( s == NULL )
		return;
	int ds, dx, sound;
	CHARACTER inrange[15];
	int y = 0, basesound = 0, xx;
	char sf;
	int distance = MAXVISRANGE + Races->VisRange( s->GetRace() );
	
	int xOffset = MapRegion->GetGridX( s->GetX() );
	int yOffset = MapRegion->GetGridY( s->GetY() );
	UI08 worldNumber = s->WorldNumber();
	for( SI08 counter1 = -1; counter1 <= 1; counter1++ )
	{
		for( SI08 counter2 = -1; counter2 <= 1; counter2++ )
		{
			SubRegion *MapArea = MapRegion->GetGrid( xOffset + counter1, yOffset + counter2, worldNumber );
			if( MapArea == NULL )	// no valid region
				continue;
			MapArea->PushChar();
			for( CChar *tempChar = MapArea->FirstChar(); !MapArea->FinishedChars(); tempChar = MapArea->GetNextChar() )
			{
				if( tempChar == NULL || tempChar->isFree() )
					continue;
				if( tempChar->IsNpc() && !tempChar->IsDead() && !tempChar->IsAtWar() && y <= 10 )
				{ 
					ds = abs( s->GetX() - tempChar->GetX());
					dx = abs( s->GetY() - tempChar->GetY());
					if( ds <= distance && dx <= distance ) 
					{
						y++;
						inrange[y] = calcCharFromSer( tempChar->GetSerial() );
					}
				} 
			}
			MapArea->PopChar();
		}
	}
	if( y > 0 )
	{
		
		sound=((rand()%(y))+1);				
		xx = chars[inrange[sound]].GetID();
		if( xx > -1 && xx < 2048 ) 
		{ 
			basesound = creatures[xx].BaseSound();
			sf = creatures[xx].SoundFlag();
		}
		else 
			return;
		if( basesound != 0 )
		{
			switch(sf) // play only idle sounds, if there arnt any, dont play them !
			{
				
			case 0: ; basesound++; break;  // normal case -> play idle sound
			case 1: ; basesound++; break; // birds sounds will be implmented later
			case 2:  // no idle sound, so dont play it !
				basesound = 0;
				break;
			case 3: // no idle sound, so dont play it !
				basesound = 0;
				break;
			case 4: // only a single sound, play it !
				break;
			}
			
			if( basesound != 0 ) // bugfix lb
			{
				CPPlaySoundEffect toSend = chars[inrange[sound]];
				toSend.Model( basesound );
				cSocket *tSend = calcSocketObjFromChar( s );
				if( tSend != NULL )
					tSend->Send( &toSend );
			}
		}
	}
	// play random mystic-sounds also if no creature is in range ...
	
	basesound = 0;
	if( RandomNum( 0, 3332 ) == 33 ) 
	{
		switch( RandomNum( 0, 6 ) )
		{
		case 0: basesound = 595;	break; // gnome sound
		case 1: basesound = 287;	break; // bigfoot 1
		case 2: basesound = 288;	break; // bigfoot 2
		case 3: basesound = 639;	break; // old snake sound
		case 4: basesound = 179;	break; // lion sound 
		case 5: basesound = 246;	break; // mystic
		case 6: basesound = 253;	break; // mystic II
			
		}
		if( basesound != 0 )
		{ 
			CPPlaySoundEffect toSend = (*s);
			toSend.Model( basesound );
			cSocket *tSock = calcSocketObjFromChar( s );
			if( tSock != NULL )
				tSock->Send( &toSend );
		}
	}
}

